import React, { Component } from 'react';
import logo from '../logo/WhatTimeIsItRightNow_logo.png';

export default class Main extends Component {
    constructor(props) {
        super(props);
        this.state = {date: new Date()};
    }

    componentDidMount() {
        this.timerID = setInterval(
           () => this.tick(),
           1000
       );
    }

    componentWillUnmount() {
        clearInterval(this.timerID);
    }

    tick() {
        this.setState({
            date: new Date()
        });
    }

    render() {
        return (
            <div>
                <Logo />
                <WhatTimeIsItRightNowDotCom date={this.state.date} />
            </div>
        );
    }
}

function WhatTimeIsItRightNowDotCom(props) {
    return (<div>{props.date.toLocaleTimeString()}</div>);
}

function Logo() {
    return (<h1><img src={logo} alt='WhatTimeIsItRightNow Logo' /></h1>);
}
